const colors = {
  blue: ["#3692FF", "#1967D6", "#1251AA"],
  white: "#FFF",
  black: "#1F2937",
  gray: ["#9CA3AF", "#F3F4F6", "#F9FAFB"],
};

const mediaQuery = {
  mobile: "screen and (max-width: 767px)",
  tablet: "screen and (min-width: 768px)",
  desktop: "screen and (min-width: 1280px)",
};

const theme = {
  colors,
  mediaQuery,
};

export default theme;
